import Vue from "vue";
import Router from "vue-router";
import App from "./pages/event.vue";
import Setting from "./pages/setting.vue";
import Login from "./pages/login.vue";
import Regestration from "./pages/regestration.vue";
import EventId from "./pages/events/_id";
import SettingId from "./pages/settings/_id";
Vue.use(Router);

export default new Router({
  mode: "history",
  routes: [
    {
      path: "/setting",
      name:" Setting",
      component: Setting,
    },

    {
      path: "/",
      name: App,
      component: App,
    },
    {
      path: "/setting/:id",
      name: "settingsId",
      component: SettingId,
    },
    {
      path: "/event/:id",
      name: "EventId",
      component: EventId,
    },
    {
      path: "/login",
      name: "Login",
      component: Login,
      meta: {
        layout: "auth-layout",
      },
    },
    {
      path: "/regestration",
      name: "Regestration",
      component: Regestration,
      meta: {
        layout: "auth-layout",
      },
    },
  ],
});
